import React from 'react'
import { fetchRequest, fetchRequestWithAuth } from '../api/requests'
import { endpoints } from '../api/endpoints'

const HomePage = () => {

  const authJWT = localStorage.getItem('authToken')
  console.log(authJWT)
  console.log(JSON.parse(authJWT).access)

  let response = fetchRequestWithAuth(
    endpoints.GETUSERFILES,
    'GET',
    '',
    authJWT
  )

  console.log(response)

  return (
    <div>
      <p>You are at HOMEPAGE!!!</p>
    </div>
  )
}

export default HomePage
